import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
class Home extends Component {
    getSomeItem = () => {
        axios
            .get('/products')
            .then(({ data }) => {
                console.log(data);
            })
            .catch((e) => {
                console.error(e);
            });
    };
    componentDidMount() {
        this.getSomeItem();
    }
    render() {
        const { history } = this.props;
        return (
            <div>
                Home
                <p>
                    <Link to="/products">Go Products</Link>
                    <button
                        onClick={() => {
                            history.push('/cart');
                        }}
                    >
                        Go Cart
                    </button>
                </p>
            </div>
        );
    }
}

export default Home;
